const getColumns = (data: UserClusters, departments: ReferenceBookType[], positions: ReferenceBookType[], projects: ReferenceBookType[], roles: ReferenceBookType[]) => {
    const result: ColumnsType<UserClusters> = [];

    result.push({
        title: 'Данные сотрудника',
        key: 'employeeData',
        dataIndex: 'user',
        fixed: true,
        children: [
            {
                title: 'ФИО',
                key: 'fioUser',
                dataIndex: ['user', 'fioUser'],
                width: 300,
                fixed: true,
                filters: DATA.map(e => ({ text: e.user.fioUser, value: e.user.id })),
                filterSearch: true,
                onFilter: (value, record) => record.user.id === value,
            },
            {
                title: 'Должность',
                key: 'position',
                dataIndex: ['user', 'idPosition'],
                fixed: true,
                render: (id) => positions.find(pos => pos.id === id)?.name,
                sorter: (a, b) => alphabetSort(
                    String(positions.find(pos => pos.id === a.user.idPosition)?.name),
                    String(positions.find(pos => pos.id === b.user.idPosition)?.name)
                ),
                filters: positions.map(e => ({ text: e.name, value: e.id })),
                filterSearch: true,
                onFilter: (value, record) => record.user.idPosition === value,
            },
            {
                title: 'Отдел',
                key: 'department',
                dataIndex: ['user', 'idDepartment'],
                fixed: true,
                render: (id) => departments.find(dep => dep.id === id)?.name,
                sorter: (a, b) => alphabetSort(
                    String(departments.find(dep => dep.id === a.user.idDepartment)?.name),
                    String(departments.find(dep => dep.id === b.user.idDepartment)?.name)
                ),
                filters: departments.map(e => ({ text: e.name, value: e.id })),
                filterSearch: true,
                onFilter: (value, record) => record.user.idDepartment === value,
            },
            {
                title: 'Роль',
                key: 'role',
                dataIndex: ['user', 'idRole'],
                fixed: true,
                render: (id) => roles.find(role => role.id === id)?.name,
                sorter: (a, b) => alphabetSort(
                    String(roles.find(role => role.id === a.user.idRole)?.name),
                    String(roles.find(role => role.id === b.user.idRole)?.name)
                ),
                filters: roles.map(e => ({ text: e.name, value: e.id })),
                filterSearch: true,
                onFilter: (value, record) => record.user.idRole === value,
            },
            {
                title: 'Проект',
                key: 'projects',
                dataIndex: ['user', 'idProject'],
                fixed: true,
                render: (id) => projects.find(proj => proj.id === id)?.name ?? '—',
                sorter: (a, b) => alphabetSort(
                    String(projects.find(proj => proj.id === a.user.idProject)?.name),
                    String(projects.find(proj => proj.id === b.user.idProject)?.name)
                ),
                filters: projects.map(e => ({ text: e.name, value: e.id })),
                filterSearch: true,
                onFilter: (value, record) => record.user.idProject === value,
            },
        ]
    })

    data.clusters.forEach((cluster, clusterIndex) => {
        result.push({
            title: cluster.name,
            key: cluster.id,
            children: cluster.properties.map((prop, propIndex) => ({
                title: prop.name,
                key: prop.id,
                dataIndex: ['clusters', clusterIndex, 'properties', propIndex],
                render: (prop) => getValueViewByPropType(prop.type, prop.value[getPropValueByPropType(prop.type)])
            }))
        })
    })

    return result
}

